import React, {Component} from 'react';

export default class Content extends Component{
    render() {
        let photoFilter = this.props.photos.filter((photo)=>(photo.category === this.props.currentAlbum))
        return (
            <ul>
                {photoFilter.map((photo)=>
                    (<p key={photo._id}>{this.props.currentAlbum}
                        <button>
                            {photo.brend}, {photo.model}
                        </button>
                    </p> ))}
            </ul>
        )
    }
}
